          <div className="hero-section">
            <h1 className="hero-title">Indian Food is more than curry</h1>
            <p className="hero-description">
              Learn more about dishes, ingredients, cultures in Indian cuisine.
            </p>
            <p className="cta-text">Stop wondering, Join now</p>
          </div>

      </div>
    </div>
  );
}
